package com.ibm.toneanalysis.model;

public class SocialTendenciesTone {
	
	Double openness;
	Double concientiousness;
	Double extraversion;
	Double agreeableness;
	Double emotionRange;
	
	public SocialTendenciesTone() {
		// TODO Auto-generated constructor stub
	}
	
	public Double getOpenness() {
		return openness;
	}
	public void setOpenness(Double openness) {
		this.openness = openness;
	}
	public Double getConcientiousness() {
		return concientiousness;
	}
	public void setConcientiousness(Double concientiousness) {
		this.concientiousness = concientiousness;
	}
	public Double getExtraversion() {
		return extraversion;
	}
	public void setExtraversion(Double extraversion) {
		this.extraversion = extraversion;
	}
	public Double getAgreeableness() {
		return agreeableness;
	}
	public void setAgreeableness(Double agreeableness) {
		this.agreeableness = agreeableness;
	}
	public Double getEmotionRange() {
		return emotionRange;
	}
	public void setEmotionRange(Double emotionRange) {
		this.emotionRange = emotionRange;
	}

}
